import { Link } from 'react-router-dom';
function CalendarHome() {
    return (
      <form>
      <nav className="navigation">
        <ul>
          <li>Calendar</li>
          <li>Schedule</li>
          <li>Account</li>
          <li>Logout</li>
        </ul>
      </nav>
      <h1>Home for Employee</h1>
      </form>
    );
  }

  export default CalendarHome;
